import React from 'react'

const PricingItem = () => {
  return (
    <div>
        <div className="flex items-center">
            <div className='w-[3em] h-[3em] rounded-full border-4 border-white'></div>
            <div className='p-1 border-4 rounded-lg border-green-600'>Individual</div>
        </div>
    </div>
  )
}

export default PricingItem
